    false,nt"url": null,nt"notes": "This annual narrative report for Swan Lake
    National Wildlife Refuge summarizes Refuge activities during the 1997 calendar year.
     The report begins with an introduction to the Refuge and a summary of the yearu2019s
    highlights and climatic conditions.  Information about monitoring and studies- including
    surveys and censuses- is provided next.  Habitat restoration and management projects
    are also covered; activities include water level management, moist soil management,
    farming, prescribed burning, and vegetation control.  Fish and wildlife management
    is discussed next with emphasis on bird banding, disease monitoring, and wildlife
    diversity.  Coordination activities, such as interagency coordination, private land
    activities, and volunteer programs, are outlined.  The resource protection section
    provides information about law enforcement, threats, conflicts, and easements.  Information
    about public education and recreation is given including visitor services, hunting,
    and fishing.  Finally, Refuge planning and administration are discussed.",nt"license_title":
